// react
import React from 'react';

// third-party
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';

// application
import LogoPanel from './LogoPanel';
import NavigationPanel from './NavigationPanel';

function Header(props) {
    const { layout } = props;
    let bannerSection;

    if (layout === 'compact') {
        bannerSection = (
            <div className="ekat-header__banner">
                Banner section
            </div>
        );
    }

    return (
        <div className="ekat-header">
            {/*
             // Logo panel
             */}
            <div className="ekat-header__logo-panel">
                <LogoPanel />

                {bannerSection}
            </div>
            
            {/*
             // Navigation panel
             */}
            <div className="ekat-header__nav-panel">
                <NavigationPanel />
            </div>
        </div>
    );
}

Header.propTypes = {
    /** one of ['default', 'compact'] (default: 'default') */
    layout: PropTypes.oneOf(['default', 'compact']),
};

Header.defaultProps = {
    layout: 'default',
};

export default Header;
